В компанию "Столбери" требуется Менеджер по работе с клиентами

ЗП от 26 000 до 96 000 руб. на руки

Если Вы:
🔹 любите общаться, можете устанавливать и поддерживать контакт с любым человеком;
🔹 любите помогать другим, энергичны, нацелены на результат и способны доводить дела до конца;
🔹 способны точно, правильно понимать и быстро выполнять поставленные задачи;
🔹 умеете и любите самостоятельно находить решения, претворять их в жизнь и достигать результата;
🔹 любите порядок и умеете его создавать;
🔹 способны планировать свою работу и стремитесь быть профессионалом в своей области;
🔹 способны работать в команде, доброжелательны к людям, готовы помогать, поддерживать и сотрудничать,
🔹 то приглашаем Вас стать членом нашей динамично развивающейся компании.

Что Вы будете делать:
🔹 общаться с потенциальными клиентами, используя стандарты компании по технологии продаж;
🔹 демонстрировать и проводить презентацию товаров компании;
🔹 вести базу данных по клиенту, уметь получать от него обратную связь;
🔹 оформлять первичные документы, соблюдать правила кассовой дисциплины.

Менеджер по работе с клиентами, который пройдет конкурс, получит возможность:
🔹 работать в команде, где любят, ценят и уважают продуктивных людей;
🔹 углублять свои знания и улучшать практические навыки, проходя как внутреннее, так и внешнее профессиональное обучение в области продаж до уровня эксперта в этой области;
🔹 иметь прозрачную и понятную финансовую мотивацию;
🔹 влиять на свой доход, держать его под своим контролем и увеличивать его;
🔹 расти по карьерной лестнице: менеджер по работе с клиентами – управляющий розничным салоном - начальник отдела продаж - руководитель отделения – заместитель директора –директор.

