В ИП Сорочан М.В. требуется Продавец-кассир/Сотрудник универсал

ЗП от 25 000 руб. на руки

Почему круто продавать сэндвичи Subway?
🔹 Subway - это всегда свежие продукты, за которые не придется краснеть;
🔹 разнообразие видов сэндвичей способно впечатлить даже самого гастрономически искушенного гостя за отличный средний чек;
🔹 мы отменили все запреты: каждый может создать свой сэндвич таким, каким пожелает: с любой начинкой.

Что Вы будете делать?
🔹 собирать и продавать самые свежие, вкусные и хрустящие сэндвичи;
🔹 работать с кассой;
🔹 делать заготовки.

Что приобретаете?
🔹 возможность прикоснуться к мировой легенде;
🔹 молодой дружный коллектив;
🔹 оплаченные обеды;
🔹 достойная почасовая заработная плата.

Какие у Вас будут перспективы карьерного роста?
🔹 сотрудник универсал;
🔹 менеджер;
🔹 управляющий.

Как Вы будете учиться и развиваться в Компании?
🔹 в компании есть продвинутое обучение для каждого сотрудника;
🔹 вы будете идти бок о бок с лучшими мастерами своего дела.

